import {Link} from 'react-router-dom';

function MainNav(){
    return(
        <nav>
            <ul>
                <li>
                    <Link to="/">Home </Link>
                    <Link to="/Products"> Products</Link>
                </li>
            </ul>
        </nav>
    )
}

export default MainNav;
